#include <bits/stdc++.h>

constexpr int MAX_CH = 'z'-'0';
int freq[MAX_CH+1];
std::array<std::pair<int, char>, MAX_CH+1> freq_ch;

class Solution {
 public:
  static std::string frequencySort(std::string& s) {
    memset(&freq, 0, sizeof(freq));
    for (const auto ch : s) {
      ++freq[ch-'0'];
    }
    std::fill(freq_ch.begin(), freq_ch.end(), std::pair<int, char>{0, 'z'+1});
    for (int i = 0; i <= MAX_CH; ++i) {
      freq_ch[i] = {freq[i], '0'+i};
    }
    std::sort(freq_ch.rbegin(), freq_ch.rend());
    int si = 0;
    for (int i = 0; i <= MAX_CH; ++i) {
      const auto ch = freq_ch[i].second;
      for (int j = 0; j < freq_ch[i].first; ++j) {
        s[si] = ch;
        ++si;
      }
    }
    return s;
  }
};

int main() {
  {
    std::string s("tree");
    const std::vector<std::string> expected{"eert", "eetr"};
    const std::string actual = Solution::frequencySort(s);
    assert(std::any_of(expected.begin(), expected.end(), [&actual](const auto& e) {
      return e == actual;
    }));
  }
  {
    std::string s("cccaaa");
    const std::vector<std::string> expected{"aaaccc", "cccaaa"};
    const std::string actual = Solution::frequencySort(s);
    assert(std::any_of(expected.begin(), expected.end(), [&actual](const auto& e) {
      return e == actual;
    }));
  }
  {
    std::string s("Aabb");
    const std::vector<std::string> expected{"bbAa", "bbaA"};
    const std::string actual = Solution::frequencySort(s);
    assert(std::any_of(expected.begin(), expected.end(), [&actual](const auto& e) {
      return e == actual;
    }));
  }
  {
    std::string s("");
    const std::string actual = Solution::frequencySort(s);
    const std::string expected("");
    assert(actual == expected);
  }

  return 0;
}
